import background from './images/background.jpg';
import './App.css';

function App() {
  return (
    <div className="App">
      <div className="background">
          <div className="title">
            Space Invaders
          </div>
          <div className="under-title">
            The force will be with you, always
          </div>

        <button className="start-button">
          START
        </button>
      </div>

    </div>
  );
}

export default App;
